import React from "react";

import { AiFillFacebook, AiFillLinkedin } from "react-icons/ai";
import ProfilePhoto from './img/photo-test-u02.jpg';

import './css/Profile.css';

class Profile extends React.Component {

  render() {

    const iconsColor = '#fff';

    return(
      <div className='Section'>
        <div className="Profile-Info">
          <div className="Profile-Info-Name"><strong>Tomáš KARBAN</strong></div>
          <div className="Highligh-Green-Text"><strong>Developer</strong></div>
          <div className="Profile-Info-Contact"><span><AiFillFacebook color={iconsColor}/></span><span><AiFillLinkedin color={iconsColor}/></span></div>
        </div>
        <img src={ProfilePhoto} alt="Logo" />
      </div>
    );
  }
}

export default Profile;
